import React from 'react';

class Highlight extends React.Component {
  render() {
    return (
        <span class={"highlight-" + this.props.color}>
            {this.props.children}
        </span> 
      );
    }
}

export default Element;

const Red = ({ children }) => {
    return Highlight({ children, color: "salmon" });
};

const Blue = ({ children }) => {
    return Highlight({ children, color: "lightblue" });
};

const Green = ({ children }) => {
    return Highlight({ children, color: "green" });
};

const Yellow = ({ children }) => {
    return Highlight({ children, color: "highlight" });
}


export { Red, Blue, Green, Yellow };
